import itertools
def acmTeam(topic):
    combinations = list(itertools.combinations(topic, 2))
    maximum = 0
    pairs = 0
    for combination in combinations:
        print(combination)
        x = int(combination[0],base=2)
        y = int(combination[1],base=2)
        print("\n",x)

        print("\n",y)
        result = x | y
        result = '{:b}'.format(result)
        print(result)
        print("-------------------------------")
        count = 0
        print(len(result))
        for subject in result:
            if subject == '1':
                count +=1
        if count > maximum:
            maximum = count
            pairs = 1
        elif count == maximum:
            pairs += 1

    return [maximum, pairs] 


print(acmTeam(["",
               
               ""]))

